#cfa7a0f sulla funzione di gestione musicale #n
-In giochi online, solo l'host o il server ha l'autorità per esercitare le operazioni di gestione nel lettore musicale, come la pausa, la prossima canzone, la cancellazione del brano, ecc.;

#cfa7a0f A proposito di contenuti musicali che possono essere giocati su richiesta #n
-Per il momento, sono supportati solo alcune canzoni autorizzate da QQ Music. Attualmente, stiamo cercando più permessi di canto-on-demand, quindi resta sintonizzati;

#cfa7a0f Informazioni sulle restrizioni su richiesta nella modalità online #n
-MUSIC GIÀ NELLA LISTA DI PRINCIPALE PUO 'Non è possibile aggiungere ripetutamente su richiesta;
-Non-proprietari di case possono solo aggiungere tre brani alla lista d'attesa allo stesso tempo. Dopo aver raggiunto il limite superiore, hanno bisogno di aspettare le canzoni che sono state ordinate di finire o essere cancellate dal proprietario della casa prima che possano riordinarle;

#cfa7a0f Informazioni sulla modalità di riproduzione musicale #n
-Queue Play: Play nell'ordine della coda di gioco e la canzone verrà rimossa dalla coda dopo che è stata riprodotta.
-Loop Play: Gioca nell'ordine della coda di riproduzione e la canzone rimarrà nella lista d'attesa dopo la riproduzione.

#cfa7a0f sulla funzione di riproduzione completa #n
-Quando è acceso, tutti i giocatori del gioco possono aggiungere canzoni alla coda di gioco.
-Quando chiuso, solo l'host o il server nel gioco può aggiungere brani alla coda di gioco.

1. Gli avventurieri hanno l'opportunità di innescare un pacchetto regalo a sorpresa quando completano varie azioni di gioco;
2. Ogni confezione regalo di evento innescato può essere acquistato solo una volta, e il pacchetto regalo scompare dopo che l'acquisto è completato;
3. Ogni pacchetto regalo a sorpresa ha un timer di conto alla rovescia separato. Dopo il conto alla rovescia, il pacchetto regalo scompare. Non perderlo, ogni avventuriero!

Il pulsante sinistro è selezionato: Quando l'elemento principale cambia, la distanza tra l'elemento figlio e il bordo sinistro dell'elemento genitore non cambiano;
-Il pulsante a destra è selezionato: quando l'elemento genitore cambia, la distanza tra l'elemento figlio e il bordo destro dell'elemento genitore non cambia;
Il pulsante -UPPER è selezionato: Quando il elemento principale cambia, la distanza tra l'elemento figlio e il bordo superiore dell'elemento genitore non cambia;
-Il pulsante in basso è selezionato: quando l'elemento principale cambia, la distanza tra l'elemento figlio e il bordo inferiore dell'elemento genitore non cambia;
-Lo pulsanti sinistro e destro sono selezionati contemporaneamente: quando l'elemento genitore cambia, la distanza orizzontale tra l'elemento figlio e il punto centrale dell'elemento genitore non cambia;
I pulsanti -UP e DOW sono selezionati contemporaneamente: quando l'elemento principale cambia, la distanza verticale tra l'elemento figlio e il punto centrale dell'elemento genitore non cambia;
